import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <table class="blueTable">
      <tbody>
        <tr>
          <td>{data.name}</td>
          <td></td>
          <td></td>
        </tr>
        <tr>
          <td>{data.desc}</td>
          <td></td>
          <td></td>
          <td></td>
          <td>{data.price}</td>
        </tr>
      </tbody>
    </table>

  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
